import React from 'react';

class SearchBar extends React.Component {
    state = {
        search: []
    }
    onSearch(e){
        e.preventDefault();
    }
    render() {
        return (
            <div>
                <form className="ui fluid icon input">
                    <h3 className="ui header">Search</h3>
                    <input type="text" placeholder="Search...">{this.state.search}</input>
                </form>
            </div>
        )
    }
}

export default SearchBar;
